import React, { Component } from "react";
import './App.scss';
import {
    BrowserRouter, Link
} from "react-router-dom";
import Home from "./Home";
import About from "./About";
import Overview from "./Overview";
import Demo from "./Demo";
import Contact from "./Contact";
import logo from './images/Logo/YMP small logo no bg.png';
import user from './images/Logo/user-solid.svg';
import 'bootstrap/dist/css/bootstrap.min.css';
import {
    Container, Row, Col, Navbar, Nav,
} from 'react-bootstrap';
import ReactFullpage from '@fullpage/react-fullpage';
import "fullpage.js/vendors/scrolloverflow";

class Header extends Component {
    refA = React.createRef()
    refB = React.createRef()
    refC = React.createRef()
    refD = React.createRef()
    refE = React.createRef()

    componentDidMount() {
        this.setState({ loaded: true })
    }

    handleScrollTo = (elRef) => {
        // Incase the ref supplied isn't ref.current
        const el = elRef.current ? elRef.current : elRef

        // Scroll the element into view
        el.scrollIntoView({
            behavior: 'smooth',
            block: 'start'
        })
    }

    onLeave(origin, _destination, _direction) {
        console.log("Leaving section " + origin.index);
    }
    afterLoad(_origin, destination, _direction) {
        console.log("After load: " + destination.index);
    }

    render() {
        return (
            <BrowserRouter>
                <div className="App-header">
                    <Navbar fixed="top" collapseOnSelect expand="lg" variant="dark" justify-content-between="true">
                        <Container>
                                <Navbar.Brand href="/">
                                    <img src={logo} className="App-header-logo" alt="logo" />
                                    <span className="App-header-text">yacht maintenance program</span>
                                </Navbar.Brand>
                            <Navbar.Toggle aria-controls="responsive-navbar-nav" />
                                <Navbar.Collapse id="responsive-navbar-nav" className="justify-content-end">
                                    <Nav className="mr-auto mr-sm-2">
                                        <Nav.Link eventKey="1" as={Link} onClick={() => { this.handleScrollTo(this.refA) }}>Home</Nav.Link>
                                        <Nav.Link eventKey="2" as={Link} onClick={() => { this.handleScrollTo(this.refB) }}>About Us</Nav.Link>
                                        <Nav.Link eventKey="3" as={Link} onClick={() => { this.handleScrollTo(this.refC) }}>Overview</Nav.Link>
                                        <Nav.Link eventKey="4" as={Link} onClick={() => { this.handleScrollTo(this.refD) }}>Get A Demo</Nav.Link>
                                        <Nav.Link eventKey="5" as={Link} onClick={() => { this.handleScrollTo(this.refE) }}>Contact Us</Nav.Link>
                                        <Nav.Link className="singin" href="https://ymponline.com/">
                                            <img src={user} className="user-logo" alt="logo" />Signin
                                        </Nav.Link>
                                    </Nav>
                                </Navbar.Collapse>
                            </Container>
                        </Navbar>
                </div>
                <ReactFullpage
                    scrollOverflow={true}
                    sectionsColor={["orange", "purple", "green"]}
                    onLeave={this.onLeave.bind(this)}
                    afterLoad={this.afterLoad.bind(this)}
                    render={() => {
                        return (
                            <div className="App-content" id="fullpage-wrapper">
                                <Container>
                                    <Row>
                                        <Col>
                                            <div className="route_element section1" ref={this.refA}>
                                                <Home/>
                                            </div>
                                            <div className="route_element section" ref={this.refB}>
                                                <About/>
                                            </div>
                                            <div className="route_element section" ref={this.refC}>
                                                <Overview/>
                                            </div>
                                            <div className="route_element section" ref={this.refD}>
                                                <Demo/>
                                            </div>
                                            <div className="route_element section" ref={this.refE}>
                                                <Contact/>
                                            </div>
                                        </Col>
                                    </Row>
                                </Container>
                            </div>
                        );
                    }}
                />
            </BrowserRouter>
        );
    }
}

export default Header;
